function password_change(data) {
    close_warning();
    var point = 0;
    var value = data.value;
    var simple = new Array(
        "123456",
        "1234567",
        "12345678",
        "123456789",
        "321654",
        "654987",
        "321654987",
        "654321",
        "987654321"
    );
    var special = new Array(
        "!",
        "@",
        "#",
        "$",
        "%",
        "^",
        "&",
        "*",
        "(",
        ")",
        ",",
        ".",
        ";",
        "/",
        "|",
        "`",
        "~",
        "?",
        "<",
        ">",
        ":",
        "+",
        "-"
    );
    if (value.length > 0) {
        document.getElementById("password_checker").style.display = "inline";
        point += Math.round(value.length / 2);
        var check1 = 0;
        for (var i = 0; i < simple.length - 1; i++) {
            if (simple[i] == value) {
                check1 = 1;
            }
        }
        if (check1 == 0 && value.length >= 6) {
            point += 2;
        } else {
            point -= 4;
        }
        if (value.length >= 6) {
            for (var i = 1; i <= 2; i++) {
                var max_value = Math.round(value.length / i) * i;
                var remainder = max_value - value.length;
                var real_value = value.length - remainder;
                var value = value.substr(0, real_value);
                var data2 = value;
                var result = data2;
                for (var j = 0; j <= Math.round(data2.length / i); j++) {
                    var result = result.replace(data2.substr(0, i), "");
                }
                if (result != "") {
                    point += 2;
                } else {
                    point -= 1;
                }
            }
        }
        if (value.length >= 6) {
            for (var i = 0; i < special.length - 1; i++) {
                var str_base = value;
                var str_replace = value.replace(special[i], "");
                if (str_base.length > str_replace.length) {
                    point++;
                }
            }
        }
    } else {
        document.getElementById("password_checker").style.display = "none";
    }
    if (point >= 5) {
        document.getElementById("pwd1").innerHTML =
            '<span class="password_2">&nbsp;</span>';
    } else {
        document.getElementById("pwd1").innerHTML =
            '<span class="password_1">&nbsp;</span>';
    }
    if (point >= 10) {
        document.getElementById("pwd2").innerHTML =
            '<span class="password_2">&nbsp;</span>';
    } else {
        document.getElementById("pwd2").innerHTML =
            '<span class="password_1">&nbsp;</span>';
    }
    if (point >= 15) {
        document.getElementById("pwd3").innerHTML =
            '<span class="password_2">&nbsp;</span>';
    } else {
        document.getElementById("pwd3").innerHTML =
            '<span class="password_1">&nbsp;</span>';
    }
    if (point >= 20) {
        document.getElementById("pwd4").innerHTML =
            '<span class="password_2">&nbsp;</span>';
    } else {
        document.getElementById("pwd4").innerHTML =
            '<span class="password_1">&nbsp;</span>';
    }
    if (point >= 25) {
        document.getElementById("pwd5").innerHTML =
            '<span class="password_2">&nbsp;</span>';
    } else {
        document.getElementById("pwd5").innerHTML =
            '<span class="password_1">&nbsp;</span>';
    }
}
