function order_amount_calculate(input_id, type) {
    if (!input_id) {
        return false;
    }
    var input_cycle = document.getElementById("ord_cycle_" + input_id)
        .selectedIndex
        ? parseInt(
              document.getElementById("ord_cycle_" + input_id).options[
                  document.getElementById("ord_cycle_" + input_id).selectedIndex
              ].value
          )
        : document.getElementById("ord_cycle_" + input_id).value;
    if (type != 1) {
        order_check_priceboard(input_id, input_cycle);
    }
    if (order_has_been_total == 1) {
        var basic_amount = parseInt(
            document.getElementById("ord_basic_amount_" + input_id).value
        );
    }
    var input_vat = parseInt(
        document.getElementById("ord_vat_" + input_id).value
    );
    var input_setupfee = parseInt(
        document.getElementById("ord_setupfee_" + input_id).value
    );
    var input_price = parseInt(
        document.getElementById("ord_price_" + input_id).value
    );
    var input_payment = parseInt(
        document.getElementById("ord_cycle_type_" + input_id).value
    );
    var input_discount = parseInt(
        document.getElementById("ord_discount_" + input_id).value
    );
    var input_discountup = document.getElementById("ord_discountup_" + input_id)
        ? parseInt(document.getElementById("ord_discountup_" + input_id).value)
        : 0;
    if (input_payment == 4) {
        var input_cycle = parseInt(
            document.getElementById("ord_cycle_" + input_id).value
        );
    }
    if (document.getElementById("ord_reseller_discount_" + input_id)) {
        var input_discount_packet = parseInt(
            document.getElementById("ord_reseller_discount_" + input_id).value
        );
    }
    if (document.getElementById("ord_service_use_day_" + input_id)) {
        var input_service_use_day = document.getElementById(
            "ord_service_use_day_" + input_id
        ).value;
    }
    if (document.getElementById("ord_service_code_" + input_id)) {
        var input_service_code = document.getElementById(
            "ord_service_code_" + input_id
        ).value;
    }
    if (document.getElementById("ord_other_discount_" + input_id)) {
        var other_discount = parseInt(
            document.getElementById("ord_other_discount_" + input_id).value
        );
    }
    if (document.getElementById("ord_tpl_price_" + input_id)) {
        var tpl_price = parseInt(
            document.getElementById("ord_tpl_price_" + input_id).value
        );
    }
    if (document.getElementById("temp_discount")) {
        if (input_discount > 0) {
            document.getElementById("temp_discount").innerHTML =
                number_format(input_discount, ",") + " " + site_currency;
        } else {
            document.getElementById("temp_discount").innerHTML = "";
        }
    }
    if (document.getElementById("ord_promotion_discount_" + input_id)) {
        var promotion_discount = parseInt(
            document.getElementById("ord_promotion_discount_" + input_id).value
        );
    }
    if (document.getElementById("service_price_" + input_id)) {
        var service_price = document.getElementById(
            "service_price_" + input_id
        ).value;
    }
    if (document.getElementById("promotion_new_domain_" + input_id)) {
        var promotion_new_domain = document.getElementById(
            "promotion_new_domain_" + input_id
        ).value;
    }
    if (document.getElementById("ord_quantity_" + input_id)) {
        var ord_quantity = parseInt(
            document.getElementById("ord_quantity_" + input_id).value
        );
    }
    var amount = order_calculate_amount(
        input_payment,
        input_setupfee,
        input_price,
        input_cycle,
        input_discount,
        document.getElementById("ord_discount_" + input_id),
        input_discountup,
        document.getElementById("ord_discountup_" + input_id),
        service_price,
        promotion_new_domain
    );
    if (input_service_code) {
        if (
            (input_service_code == "web4steps" ||
                (input_service_code == "dt_web4steps" &&
                    !input_service_use_day)) &&
            other_discount &&
            !input_discountup
        ) {
            amount = Math.round(amount - (amount * other_discount) / 100);
        }
        if (input_service_code == "template") {
            amount = tpl_price;
        }
    }
    if (promotion_discount) {
        var code_type = document.getElementById(
            "ord_code_type_" + input_id
        ).value;
        amount =
            code_type == 1
                ? Math.round(amount - (amount * promotion_discount) / 100)
                : amount - promotion_discount;
    }
    if (ord_quantity) {
        amount = amount * ord_quantity;
    }
    var subtotal = order_calculate_total(amount, input_vat, input_id);
    document.getElementById("ord_basic_amount_" + input_id).value = subtotal;
    newtotal = subtotal;
    subtotal = Math.round(subtotal);
    order_total += subtotal;
    subtotal = number_format(subtotal, ",") + " " + site_currency;
    document.getElementById("ord_amount_" + input_id).innerHTML = subtotal;
    if (order_has_been_total == 1) {
        order_total = order_total - basic_amount;
        order_total_calculate();
    }
}
function order_calculate_amount(
    input_payment,
    input_setupfee,
    input_price,
    input_cycle,
    input_discount,
    object_discount,
    input_discountup,
    object_discountup,
    service_price,
    promotion_new_domain
) {
    var amount = 0;
    var amount_bk = 0;
    input_setupfee = !isNaN(input_setupfee) ? input_setupfee : 0;
    input_price = !isNaN(input_price) ? input_price : 0;
    input_cycle = !isNaN(input_cycle) ? input_cycle : 1;
    input_payment = !isNaN(input_payment) ? input_payment : 1;
    if (promotion_new_domain) {
        amount =
            input_setupfee +
            input_price -
            ((input_setupfee + input_price) * 15) / 100 +
            (input_cycle > 1 ? input_price * (input_cycle - 1) : 0);
    } else {
        if (input_payment == 4) {
            amount =
                input_setupfee +
                input_price * (input_cycle > 0 ? input_cycle : 1);
        } else if (input_payment == 1) {
            amount =
                input_setupfee +
                input_price * (input_cycle > 0 ? input_cycle : 1);
        } else if (input_payment == 2) {
            amount =
                input_setupfee +
                input_price * (input_cycle > 0 ? input_cycle : 1);
        } else if (input_payment == 3) {
            amount = input_setupfee + input_price * 1;
        } else {
            amount = 0;
        }
    }
    amount = input_discount ? amount - input_discount : amount;
    amount = input_discountup ? amount - input_discountup : amount;
    amount = amount > 0 ? amount : 0;
    amount = Math.round(amount);
    return amount;
}
function order_calculate_total(input_amount, input_vat, input_id) {
    var total = 0;
    input_vat = !isNaN(input_vat) ? input_vat : 0;
    if (input_vat) {
        var temp_vat = (input_amount / 100) * (input_vat > 0 ? input_vat : 0);
        temp_vat = number_format(temp_vat, ",") + " " + site_currency;
        if (document.getElementById("temp_vat_" + input_id)) {
            document.getElementById("temp_vat_" + input_id).innerHTML =
                temp_vat;
        }
    }
    total =
        input_amount + (input_amount / 100) * (input_vat > 0 ? input_vat : 0);
    return total;
}
