function set_defaultvalue(id_form) {
    $("#" + id_form + ":first :input").each(function () {
        var at = $(this).attr("defaultvalue");
        if (at != undefined && at != "") {
            $(this).val(at);
            $(this)
                .find('option[value="' + at + '"]')
                .attr("selected", true);
        }
    });
}
var is_finish = 0;
function cart_clone_declaration(form_id, d1, d2) {
    d1 = "_" + d1;
    var temp_d2 = parseInt(d2) + 1;
    d2 = "_" + (parseInt(d2) + 1);
    is_finish = 0;
    var is_update = 0;
    if (document.getElementById("cus_other_info" + d1)) {
        var temp_ob = document.getElementById("cus_other_info" + d1);
        if (temp_ob.options[temp_ob.selectedIndex].value) {
            is_update = 1;
            update_owner_info(
                temp_ob.options[temp_ob.selectedIndex].value,
                temp_d2,
                "",
                temp_ob
            );
        }
    }
    if (is_update == 1) {
        waitForIt();
    } else {
        var frm = document.forms[form_id];
        var numberElements = frm.elements.length;
        for (var i = 0; i < numberElements; i++) {
            object = frm.elements[i];
            if (
                object.name.split("_").length >= 4 &&
                !object.name.match(/time|type|syntax|amount|password/gi) &&
                object.name.substr(object.name.length - d1.length) == d1
            ) {
                object2 =
                    object.name.substr(0, object.name.length - d1.length) + d2;
                if (document.getElementById(object2)) {
                    if (document.getElementById(object2).tagName == "INPUT") {
                        document.getElementById(object2).value = object.value;
                    } else if (
                        document.getElementById(object2).tagName == "SELECT"
                    ) {
                        var selectob = document.getElementById(object2);
                        var selected = object.options[object.selectedIndex]
                            ? object.options[object.selectedIndex].value
                            : "";
                        selectob.innerHTML = object.innerHTML;
                        for (var j = 0; j < selectob.length; j++) {
                            if (selectob.options[j].value == selected) {
                                selectob.options[j].selected = true;
                            }
                        }
                    }
                }
            }
        }
    }
    function waitForIt() {
        if (!is_finish) {
            setTimeout(function () {
                waitForIt();
            }, 1000);
        } else {
            var frm = document.forms[form_id];
            var numberElements = frm.elements.length;
            for (var i = 0; i < numberElements; i++) {
                object = frm.elements[i];
                if (
                    object.name.split("_").length >= 4 &&
                    !object.name.match(/time|type|syntax|amount|password/gi) &&
                    object.name.substr(object.name.length - d1.length) == d1
                ) {
                    object2 =
                        object.name.substr(0, object.name.length - d1.length) +
                        d2;
                    if (document.getElementById(object2)) {
                        if (
                            document.getElementById(object2).tagName == "INPUT"
                        ) {
                            document.getElementById(object2).value =
                                object.value;
                        } else if (
                            document.getElementById(object2).tagName == "SELECT"
                        ) {
                            var selectob = document.getElementById(object2);
                            var selected = object.options[object.selectedIndex]
                                ? object.options[object.selectedIndex].value
                                : "";
                            selectob.innerHTML = object.innerHTML;
                            for (var j = 0; j < selectob.length; j++) {
                                if (selectob.options[j].value == selected) {
                                    selectob.options[j].selected = true;
                                }
                            }
                        }
                    }
                }
            }
        }
    }
}
