function set_border_input_color(name, succes_color, error_color) {
    if ($("input[name='" + name + "']").val() != "") {
        $("input[name='" + name + "']").css(
            "border",
            "2px solid " + succes_color
        );
    } else {
        $("input[name='" + name + "']").css(
            "border",
            "2px solid " + error_color
        );
    }
}
function set_border_select_color(name, succes_color, err_color) {
    if ($("select[name='" + name + "']").val() != null) {
        $("select[name='" + name + "']").css(
            "border",
            "2px solid " + succes_color
        );
    } else {
        $("select[name='" + name + "']").css(
            "border",
            "2px solid " + err_color
        );
    }
}
function set_border_select_gender(name, succes_color, err_color) {
    if (
        $("select[name='" + name + "']").val() == "Ông" ||
        $("select[name='" + name + "']").val() == "Bà"
    ) {
        $("select[name='" + name + "']").css(
            "border",
            "2px solid " + succes_color
        );
    } else {
        $("select[name='" + name + "']").css(
            "border",
            "2px solid " + err_color
        );
    }
}
