function update_promotion_incentives_domainvn(input_id) {
    if (!input_id) return false;
    var input_cycle = document.getElementById("ord_cycle_" + input_id)
        .selectedIndex
        ? parseInt(
              document.getElementById("ord_cycle_" + input_id).options[
                  document.getElementById("ord_cycle_" + input_id).selectedIndex
              ].value
          )
        : document.getElementById("ord_cycle_" + input_id).value;
    var input_setupfee = parseInt(
        document.getElementById("ord_setupfee_" + input_id).value
    );
    var input_price = parseInt(
        document.getElementById("ord_price_" + input_id).value
    );
    var input_reseller_id = parseInt(
        document.getElementById("reseller_id_" + input_id).value
    );
    var discount_percent = 0;
    var discount_price = 0;
    if (input_reseller_id > 0) return discount_price;
    else {
        if (input_cycle >= 2 && input_cycle < 5) {
            discount_percent = 0.05;
        } else if (input_cycle >= 5 && input_cycle < 10) {
            discount_percent = 0.1;
        } else if (input_cycle >= 10) {
            discount_percent = 0.2;
        }
        discount_price = (input_setupfee + input_price) * discount_percent;
    }
    if (document.getElementById("ord_promotion_discount_" + input_id))
        document.getElementById("ord_promotion_discount_" + input_id).value =
            discount_price;
    if (document.getElementById("promotion_discount_" + input_id))
        document.getElementById("promotion_discount_" + input_id).innerHTML =
            number_format(discount_price, ",") + " " + site_currency;
}
