function init_fixed_widget(widget) {
    var sticky = widget;
    var stickyStopper = $(".end_fixed_widget").offset().top;
    var stickyTop = $(".content-ckeckout").offset().top;
    var headerTop = $(".header-top").innerHeight();
    var stickyHeight = widget.innerHeight();
    $(window).scroll(function () {
        var list_service_height = $(".list_cart_choosen_product").innerHeight();
        var total_amount_widget_height = $(
            "#total_amount_widget"
        ).innerHeight();
        if (list_service_height <= total_amount_widget_height) return false;
        if (!sticky) return false;
        stickyStopper -= stickyHeight;
        var currentPosition = $(this).scrollTop();
        if (currentPosition > headerTop) {
            sticky.addClass("fixed_widget");
            if (currentPosition >= stickyStopper - 150) {
                sticky.css({
                    position: "absolute",
                    top: stickyStopper - 220,
                    bottom: "inherit",
                });
            } else {
                sticky.css({
                    position: "fixed",
                    top: headerTop,
                    bottom: "inherit",
                });
            }
        } else {
            sticky.css({
                position: "inherit",
                top: "inherit",
                bottom: "inherit",
            });
            sticky.removeClass("fixed_widget");
        }
    });
}
