var is_in_array = 0;
function cart_checkdomain() {
    registerdomain_checked = 0;
    var frm = document.forms["cart"];
    var numberElements = frm.elements.length;
    var domain = new Array();
    var cnt = 0;
    for (var i = 0; i < numberElements; i++) {
        var object = frm.elements[i].name;
        if (object.substr(0, 10) == "ord_domain") {
            var service_type = object.split("_");
            var service_name = document.getElementById(
                "ord_service_name_" + service_type[service_type.length - 1]
            ).value;
            var service_type = document.getElementById(
                "ord_service_type_" + service_type[service_type.length - 1]
            ).value;
            if (service_type) {
                domain[cnt] = frm.elements[i];
                check_inputdomain(domain[cnt].value);
                if (is_in_array == 1) {
                    alert("Vui lòng nhập tên miền không dấu để kiểm tra");
                    domain[cnt].focus();
                    return false;
                }
                var domainext = get_domain_ext(domain[cnt].value);
                var domainname = get_domain_name(domain[cnt].value);
                if (domainext == ".vn") {
                    if (domainname.length <= 2) {
                        alert("Sai định dạng tên miền. Vui lòng nhập lại!");
                        domain[cnt].focus();
                        return false;
                    }
                }
                if (domainext == ".com.vn") {
                    if (domainname.length <= 1) {
                        alert("Sai định dạng tên miền. Vui lòng nhập lại!");
                        domain[cnt].focus();
                        return false;
                    }
                }
                if (service_name == "whois_protect") {
                    if (
                        !domainname ||
                        !domainext ||
                        domainext.indexOf(".vn") != -1
                    ) {
                        alert("Vui lòng nhập tên miền quốc tế");
                        return false;
                    }
                } else if (
                    domainext != service_name &&
                    check_more_domain(domainext) == false
                ) {
                    alert(lang_invalid_service + " " + service_name);
                    domain[cnt].focus();
                    return false;
                }
                cnt++;
            }
        }
    }
    var domaina = new Array();
    for (var i = 0; i < domain.length; i++) {
        domain[i].value = trim(domain[i].value);
        if (domain[i].value != "") {
            var ctrlname = domain[i].name;
            var dn = domain[i].value;
            var id = ctrlname.split("_");
            id = id[id.length - 1];
            var domainname = get_domain_name(dn);
            var domainext = get_domain_ext(dn);
            var ord_is_backorder = document.getElementById(
                "order_is_backorder_" + id
            )
                ? document.getElementById("order_is_backorder_" + id).value
                : "";
            var service_name = document.getElementById("ord_service_name_" + id)
                ? document.getElementById("ord_service_name_" + id).value
                : "";
            AjaxRequest.get({
                url:
                    site_root_domain +
                    "?site=order&act=check_exist&domain=" +
                    dn,
                onLoading: function (reg) {
                    document.getElementById("result_" + id).src =
                        site_img_url + "/icons/loading.gif";
                },
                onSuccess: function (reg) {
                    if (reg.responseText == 1) {
                        alert(
                            "Tên miền này đã được đăng ký trên hệ thống, Quý khách hãy chọn tên miền khác!"
                        );
                        document.getElementById("result_" + id).src =
                            site_img_url + "/icons/result_1.png";
                        return false;
                    } else {
                        registerdomain_checked = 2;
                        cart_checkregisterdomain();
                        return false;
                        AjaxRequest.get({
                            url:
                                site_root_domain +
                                "/whois/?domain=" +
                                domainname +
                                "&ext=" +
                                domainext +
                                "&tempid=" +
                                id,
                            onLoading: function (reg) {
                                document.getElementById("result_" + id).src =
                                    site_img_url + "/icons/loading.gif";
                            },
                            onSuccess: function (reg) {
                                var result = reg.responseText.split("|");
                                if (
                                    ord_is_backorder == 1 ||
                                    service_name == "whois_protect"
                                ) {
                                    result[0] = 0;
                                    registerdomain_checked = 2;
                                    registerdomain_detected = 1;
                                    cart_checkregisterdomain();
                                } else if (result[0] == 1) {
                                    registerdomain_checked = 1;
                                    cart_checkregisterdomain();
                                } else if (
                                    registerdomain_checked != 1 &&
                                    result[0] == 0
                                ) {
                                    registerdomain_checked = 2;
                                    cart_checkregisterdomain();
                                }
                                document.getElementById(
                                    "result_" + result[1]
                                ).src =
                                    site_img_url +
                                    "/icons/result_" +
                                    result[0] +
                                    ".png";
                            },
                        });
                    }
                },
            });
        }
    }
}
