function order_check_priceboard(order_id, ovalue) {
    var hosting_percenttree = document.getElementById(
        "ord_hosting_percenttree_" + order_id
    )
        ? document.getElementById("ord_hosting_percenttree_" + order_id).value
        : "";
    var reseller_syntax = document.getElementById("reseller_syntax_" + order_id)
        ? document.getElementById("reseller_syntax_" + order_id).value
        : "";
    priceboard = document.getElementById("ord_pricetree_" + order_id);
    if (!priceboard) {
        return false;
    } else {
        priceboard = priceboard.value;
    }
    var newarray = priceboard.split("<br />");
    var percent_array = hosting_percenttree
        ? hosting_percenttree.split("<br />")
        : "";
    for (var i = 0; i < newarray.length; i++) {
        var newitem = newarray[i].split("=");
        var percent_item = percent_array[i] ? percent_array[i].split("=") : "";
        if (parseInt(ovalue) >= parseInt(newitem[0])) {
            if (document.getElementById("ord_realprice_" + order_id)) {
                if (reseller_syntax) {
                    if (reseller_syntax.indexOf("%")) {
                        var real_price =
                            parseInt(newitem[1]) -
                            (parseInt(newitem[1]) * parseInt(reseller_syntax)) /
                                100;
                    } else {
                        var real_price =
                            parseInt(newitem[1]) - parseInt(reseller_syntax);
                    }
                } else {
                    var real_price = parseInt(newitem[1]);
                }
                document.getElementById("ord_price_" + order_id).value =
                    real_price;
                document.getElementById("ord_realprice_" + order_id).innerHTML =
                    order_number_format(real_price);
                if (
                    parseInt(ovalue) >= percent_item[0] &&
                    document.getElementById("hosting_percent_discount")
                ) {
                    document.getElementById(
                        "hosting_percent_discount"
                    ).innerHTML =
                        "<span style='color:red;'>" +
                        percent_item[1] +
                        "</span>";
                }
            }
        }
    }
}
