function get_var(name, url) {
    url = url ? url : "";
    name = name.replace(/[\[]/, "\\[").replace(/[\]]/, "\\]");
    var regexS = "[\\?&]" + name + "=([^&#]*)";
    var regex = new RegExp(regexS);
    var results = regex.exec(url == "" ? window.location.href : url);
    if (results == null) return "";
    else return results[1];
}
