function transaction_balance_round(value, minvalue) {
    if (value > minvalue) {
        var temp = value / min_round_addfund;
        if (value % min_round_addfund > 0) {
            var test = temp + "";
            var balance = test.split(".");
            var test_1 = parseInt(balance[1].substring(0, 1));
            temp = test_1 >= 5 ? Math.ceil(temp) : Math.floor(temp);
            balance = temp * min_round_addfund;
            document.getElementById("transaction_balance").value = balance;
        }
    }
}
