function check_domain_transfer() {
    var domain = $("#domain").val();
    if (domain.length == 0) {
        $("#msg").html("Bạn vui lòng nhập tên miền !");
        $(".result").show();
    } else {
        if (check_domain(domain) == true) {
            $("#icon_loading").show();
            $(".result").hide();
            $.ajax({
                type: "POST",
                url: site_root_domain + "/upgrade/check_domain/",
                data: "domain=" + domain,
                success: function (html) {
                    $("#icon_loading").hide();
                    $(".result").show();
                    if (html == "nhanhoa" || html == "nhanhoa vn") {
                        $("#msg").html(
                            "<p>Thông tin tên miền: <strong> " +
                                domain +
                                " </strong></p><span>Thuộc quản lý của Nhanhoa.com</span>"
                        );
                    } else if (html == "existed") {
                        $("#msg").html(
                            "<p>Thông tin tên miền: <strong> " +
                                domain +
                                " </strong></p><span>Tên miền đã đăng ký dịch vụ.</span>"
                        );
                    } else if (html == "other") {
                        $("#msg").html(
                            "<p>Thông tin tên miền: <strong> " +
                                domain +
                                " </strong></p><span>Không thuộc quản lý của Nhanhoa.com. <a href='" +
                                site_root_domain +
                                "/?site=domain&view=info_transfer'>Click vào đây</a> để chuyển tên miền về Chúng Tôi.</span>"
                        );
                    }
                },
            });
        } else {
            $("#msg").html("Sai định dạng . Bạn vui lòng nhập lại !");
            $(".result").show();
        }
    }
}
