function check_form_regiter(form_id, div_id) {
    var status = true;
    if (document.getElementById("myModal_popup")) {
        $("#myModal_popup").modal();
    }
    $("#" + form_id + " #" + div_id + ":first :input").each(function () {
        name = $(this).attr("name");
        if ($(this).hasClass("select2-hidden-accessible")) {
            $(this).select2("destroy");
        }
        sta = open_warning(name, 0);
        if (sta == false) {
            if (document.getElementById("myModal_popup")) {
                $("#myModal_popup").modal("hide");
            }
            status = false;
            return false;
        }
    });
    if (document.getElementById("myModal_popup")) {
        $("#myModal_popup").modal("hide");
    }
    return status;
}
