function check_form_add_sub_cus(type, reseller_id, is_quick) {
    var own_type = $('input:radio[name="own_type"]:checked').val();
    if (own_type == "0") {
        var divid = "customer_info";
    } else {
        var divid = "company_info";
    }
    if (type == 1) {
        if (check_validate_form_add_cus_popup("customer", divid)) {
            $.post(
                site_root_domain + "/?site=customer&view=add_do&type=1",
                { data: $("#customer").serializeArray() },
                function (data) {
                    if (data == 0) {
                        if (own_type == 0) {
                            var msg =
                                "Tên tài khoản này đã tồn tại ! Vui lòng nhập tên khài khoản khác !";
                            _get_forcus($("#cn_name"), "cn_name", msg);
                        } else {
                            var msg =
                                "Tên tổ chức này đã tồn tại ! Vui lòng kiểm tra lại !";
                            _get_forcus($("#tc_tc_name"), "tc_tc_name", msg);
                        }
                    } else {
                        update_profile_list_ajax(data);
                        own_type_from_search = own_type;
                        if (!isNaN(is_quick) && is_quick == 1) {
                            update_owner_info(data, "all", "", "", 1);
                        } else {
                            update_owner_info(data, "all");
                        }
                        $("#myModal_popup").modal("hide");
                    }
                }
            );
        }
    } else {
        if (check_form_regiter("customer", divid)) {
            $("#customer").submit();
        }
    }
}
function check_validate_form_add_cus_popup(form_id, div_id, is_check) {
    var status = true;
    $("#" + form_id + " #" + div_id + ":first :input").each(function () {
        var _that = $(this);
        var name = _that.attr("name");
        var etype = _that.attr("etype");
        _that.css("border", "1px solid #DEDEDE");
        _that.css("background", "#FFF");
        $("#msg_" + name).remove();
        var valus = _that.val();
        var msg = _that.attr("emsg");
        if (msg == "" || msg == undefined) {
            return true;
        }
        if (valus == "" && (msg != "" || msg == undefined)) {
            status = _get_forcus(_that, name, msg);
            return false;
        } else if (etype == "phone" && _that.val() !== undefined) {
            var num_phone = _that.val();
            if (check_phone(num_phone) == false) {
                var msg =
                    "Số điện thoại không hợp lệ. Ví dụ: 090111111 hoặc 0838111111";
                status = _get_forcus(_that, name, msg);
                return false;
            }
        } else if (etype == "idcard" && _that.val() !== undefined) {
            var idcart = _that.val();
            var result = check_idcard(idcart);
            if (result != 1) {
                if (result == 2) {
                    var msg = lang_invalid_idcard_2;
                } else if (result == 3) {
                    var msg = lang_invalid_idcard_3;
                } else {
                    var msg = lang_invalid_idcard;
                }
                status = _get_forcus(_that, name, msg);
                return false;
            }
        } else if (etype == "address" && _that.val() !== undefined) {
            var temp_value = _that.val();
            value = temp_value.split(",");
            if (_that && value.length < 3) {
                var msg =
                    "Địa chỉ phải nhập đúng định dạng và khớp với Thành phố. Ví dụ: 270 Cao thắng, Phường 12, Quận 10...";
                status = _get_forcus(_that, name, msg);
                return false;
            }
            if ((is_check == 1 || is_check == undefined) && status) {
                var check_result = check_address(temp_value, name);
                if (check_result != "0") {
                    if (check_result == "2") {
                        var msg =
                            "Địa chỉ không hợp lệ hoặc không khớp với thành phố đã chọn.";
                        status = _get_forcus(_that, name, msg);
                        return false;
                    } else if (check_result == "3") {
                    } else {
                        status = _get_forcus(_that, name, lang_invalid_address);
                        return false;
                    }
                }
            }
        } else if (etype == "email" && _that.val() !== undefined) {
            var value = _that.val();
            console.log(value, "email 2");
            if (check_email(value) == false) {
                var msg =
                    "Email không đúng định dạng. Ví dụ: example@nhanhoa.com";
                status = _get_forcus(_that, name, msg);
                return false;
            }
        }
    });
    return status;
}
function _get_forcus(_that, name, msg) {
    _that.css("border", "1px solid #E25041");
    _that.css("background", "#eeccce");
    _that
        .parent()
        .append(
            "<span class='text-danger' id=msg_" + name + ">" + msg + "</span>"
        );
    _that.focus();
    return false;
}
function search_profile(ob, reseller_id, customer_remove_if_no_data, is_quick) {
    var key = ob.value;
    if (key.length < 2) {
        alert("Vui lòng nhập từ khóa từ 2 ký tự trở lên");
        return false;
    }
    if (key) {
        if (!isNaN(is_quick) && is_quick == 1) {
            var quick_param = "&is_quick=1";
        } else {
            var quick_param = "";
        }
        AjaxRequest.get({
            url:
                site_root_domain +
                "/?site=customer&view=quick_search&cus_id=" +
                key +
                "&reseller_id=" +
                reseller_id +
                quick_param,
            onLoading: function (req) {
                document.getElementById("profile_list").innerHTML =
                    lang_loading;
            },
            onSuccess: function (req) {
                document.getElementById("profile_list").innerHTML =
                    req.responseText;
                document.getElementById("profile_list_loading")
                    ? (document.getElementById(
                          "profile_list_loading"
                      ).innerHTML = "")
                    : "";
                return false;
                customer_array = req.responseText.split("||||");
                customer_record = new Array();
                customer_cnt = 0;
                var customer_html = "";
                customer_html +=
                    "<table width='100%' cellspacing='0' cellpadding='0' id='profile_list_table'><tbody id='profile_list_tr'>";
                customer_html +=
                    "</tbody></table><div id='profile_list_loading'>" +
                    lang_loading +
                    "</div>";
                var title_row = document.createElement("tr");
                var c1 = document.createElement("th");
                c1.setAttribute("style", "text-align:center;");
                c1.setAttribute("width", "8%");
                c1.innerHTML = "Mã hồ sơ";
                title_row.appendChild(c1);
                var c2 = document.createElement("th");
                c2.setAttribute("style", "text-align:center;");
                c2.setAttribute("width", "15%");
                c2.innerHTML = "Tên hồ sơ";
                title_row.appendChild(c2);
                var c3 = document.createElement("th");
                c3.setAttribute("style", "text-align:center;");
                c3.setAttribute("width", "15%");
                c3.innerHTML = "Địa chỉ";
                title_row.appendChild(c3);
                var c4 = document.createElement("th");
                c4.setAttribute("style", "text-align:center;");
                c4.setAttribute("width", "8%");
                c4.innerHTML = "Điện thoại";
                title_row.appendChild(c4);
                var c6 = document.createElement("th");
                c6.setAttribute("style", "text-align:center;");
                c6.setAttribute("width", "10%");
                c6.innerHTML = "CMND/MST";
                title_row.appendChild(c6);
                document.getElementById("profile_list").innerHTML =
                    customer_html;
                document
                    .getElementById("profile_list_tr")
                    .appendChild(title_row);
                if (customer_array.length == 1) {
                    if (customer_remove_if_no_data == 1) {
                        document.getElementById("profile_list").value = "";
                    }
                    document.getElementById("profile_list_loading").innerHTML =
                        "<b><font color='red'>" +
                        lang_no_result +
                        "</font></b>";
                } else {
                    print_profile_row();
                }
            },
        });
    }
}
function print_profile_row() {
    var i = customer_cnt;
    if (customer_array.length - 1 <= i) {
        document.getElementById("profile_list_loading").innerHTML = "";
        return false;
    }
    customer_record = customer_array[i].split("|");
    var row = document.createElement("tr");
    var style = "text-align:center;line-height:40px;";
    var cell1 = document.createElement("td");
    cell1.setAttribute(
        "style",
        (i % 2 == 0 ? "background: #F3F3F3;" : "background: #FFFFFF;") + style
    );
    cell1.setAttribute("width", "8%");
    cell1.innerHTML =
        "<input type='radio' id='cus_username' name='cus_username_search' value='" +
        customer_record[0] +
        "' onclick='set_customer(this.value,\"" +
        customer_record[2] +
        '","' +
        customer_record[7] +
        "\");'> ";
    cell1.innerHTML += "<b>" + customer_record[1] + "</b>";
    row.appendChild(cell1);
    var cell2 = document.createElement("td");
    cell2.setAttribute(
        "style",
        (i % 2 == 0 ? "background: #F3F3F3;" : "background: #FFFFFF;") + style
    );
    cell2.setAttribute("width", "25%");
    cell2.innerHTML = customer_record[2];
    row.appendChild(cell2);
    var cell3 = document.createElement("td");
    cell3.setAttribute(
        "style",
        (i % 2 == 0 ? "background: #F3F3F3;" : "background: #FFFFFF;") + style
    );
    cell3.setAttribute("width", "25%");
    cell3.innerHTML = customer_record[6];
    row.appendChild(cell3);
    var cell4 = document.createElement("td");
    cell4.setAttribute(
        "style",
        (i % 2 == 0 ? "background: #F3F3F3;" : "background: #FFFFFF;") + style
    );
    cell4.setAttribute("width", "25%");
    cell4.innerHTML = customer_record[3];
    row.appendChild(cell4);
    var cell6 = document.createElement("td");
    cell6.setAttribute(
        "style",
        (i % 2 == 0 ? "background: #F3F3F3;" : "background: #FFFFFF;") + style
    );
    cell6.setAttribute("width", "10%");
    customer_record[5] = customer_record[5] ? customer_record[5] : "";
    cell6.innerHTML = customer_record[5];
    row.appendChild(cell6);
    if (!document.getElementById("profile_list_tr")) {
        return false;
    }
    document.getElementById("profile_list_tr").appendChild(row);
    customer_cnt++;
    setTimeout("print_profile_row()", 100);
}
