function protect_addon(service_id, domain, ord_id) {
    var quantity = 1;
    $("#form-label-protect-" + ord_id).append(
        "<img src=" +
            site_root_domain +
            "/templates/images/icons/icon-loading-4.gif />"
    );
    $(".choose_protect").attr("disabled", "disabled");
    $("#choose_protect_" + ord_id).removeAttr("onclick");
    $.ajax({
        url:
            site_root_domain +
            "/?site=cart&act=multiadd&id=" +
            service_id +
            "&domain=" +
            domain +
            "&quantity=" +
            quantity +
            "&ord_id=" +
            ord_id +
            "&ajax=1",
        type: "GET",
        success: function (result) {
            $("#choose_protect_" + ord_id).attr(
                "onclick",
                "return unprotect_addon('" +
                    service_id +
                    "','" +
                    domain +
                    "','" +
                    ord_id +
                    "');"
            );
            $("#form-label-protect-" + ord_id).html("");
            $(".choose_protect").removeAttr("disabled");
        },
    });
}
function unprotect_addon(service_id, domain, ord_id) {
    $("#form-label-protect-" + ord_id).append(
        "<img src=" +
            site_root_domain +
            "/templates/images/icons/icon-loading-4.gif />"
    );
    $(".choose_protect").attr("disabled", "disabled");
    $("#choose_protect_" + ord_id).removeAttr("onclick");
    $.ajax({
        type: "GET",
        url:
            site_root_domain +
            "/?site=cart&act=delete_protect&domain=" +
            domain +
            "&ajax=1",
        success: function (html) {
            $("#choose_protect_" + ord_id).attr(
                "onclick",
                "return protect_addon('" +
                    service_id +
                    "','" +
                    domain +
                    "','" +
                    ord_id +
                    "');"
            );
            $("#form-label-protect-" + ord_id).html("");
            $(".choose_protect").removeAttr("disabled");
        },
    });
}
